sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {

  if (api.state.Selected_State != null){

    if (api.state.TrueORFalse === true){
      return 'state='+api.state.Selected_State;
    }else{
      return '';
    }
  }else{
    return '';
  }


}
